import React from 'react';
import { Box, Typography, Paper } from '@mui/material';

function MultiAgentSection() {
  return (
    <Box>
      <Typography variant="h4" gutterBottom>Sistema Multiagente</Typography>
      <Paper sx={{ p: 3 }}>
        <Typography variant="h6" gutterBottom>Piattaforma Multiagente</Typography>
        <Typography variant="body1">
          Questa sezione permette di gestire e configurare il sistema multiagente di Valis.
        </Typography>
      </Paper>
    </Box>
  );
}

export default MultiAgentSection;
